window.bookSummaryJSON = "<p><i>West World</i> meets <i>The Hunger Games</i></p> <p><i>Unfettered Journey</i> - A love and adventure story that explores the individual's quest for purpose in a richly-imagined near future.</p> <p><i>Unfettered Journey</i> is the story of an AI scientist who seeks to create robot consciousness and discovers the resilience of the human spirit. He travels to a small college to progress his quest, but instead finds love, a secret plot by unjust forces, and the answers to his fundamental questions - the nature of the conscious mind and free will.</p> <p>This book is a profound, many-layered journey that traces struggle and resilience in an imperfect world. Travel on a spiritual quest with these endearing characters to glimpse our hopeful, possible future.</p> <p>Are you looking for a very different, cross-genre listening experience?</p> <p><i>Unfettered Journey</i> in summary:<br> <br> &nbsp;</p> <p></p> <ul> <li>Paints a richly imagined, realistic future world<br> &nbsp;</li> <li>Is an action/adventure story<br> &nbsp;</li> <li>Is a love story<br> &nbsp;</li> <li>Is a story with a social justice theme<br> &nbsp;</li> <li>Is a story with strong characters<br> &nbsp;</li> <li>Asks philosophical and spiritual questions that will linger</li> </ul> <p><b>Start your journey now.</b></p>"; 
